    "author": "Unknown",
    "key": "",
    "lyrics": [
      {
        "section": "V1",
        "chord": [],
        "line": "Günahımı, lanetimi"
      },
      {
        "section": "V1",
        "chord": [],
        "line": "Acı çektim, zehire yandım."
      },
      {
        "section": "V1",
        "chord": [],
        "line": "Yüceliyimi ona indim."
      },
      {
        "section": "V1",
        "chord": [],
        "line": "O kırıldı, alçak oldu."
      },
      {
        "section": "V2",
        "chord": [],
        "line": "Onun yaralarından,"
      },
      {
        "section": "V2",
        "chord": [],
        "line": "Yüksekliyimden barış oldu."
      },
      {
        "section": "V2",
        "chord": [],
        "line": "Hepimiz yolu şaşırdık,"
      },
      {
        "section": "V2",
        "chord": [],
        "line": "Kendi yolumuza döndük."
      },
      {
        "section": "V3",
        "chord": [],
        "line": "Rabbim bilir günahımı."
      },
      {
        "section": "V3",
        "chord": [],
        "line": "Yolumuza gene koydu."
      },
      {
        "section": "V3",
        "chord": [],
        "line": "Acımızı taşıdı,"
      },
      {
        "section": "V3",
        "chord": [],
        "line": "İnançları o yüklendi."
      },
      {
        "section": "V4",
        "chord": [],
        "line": "Yollandırdı cezıya yavrusunu,"
      },
      {
        "section": "V4",
        "chord": [],
        "line": "Ama bizi ceza bozdu."
      }
    ]
