      {
        "section": "C2",
        "chord": [],
        "line": "Daha vakit varken bu yerde kabul et sen İsa'yı"
      },
      {
        "section": "V3",
        "chord": [],
        "line": "Gel bana sen gel yavrum çünkü bendedir kurtuluş çünkü tez ben gelecem alıp sizi gidecem"
      },
      {
        "section": "C3",
        "chord": [],
        "line": "İsa kıyam etti ölülerden inanıyon mu sen buna"
      },
      {
        "section": "C3",
        "chord": [],
        "line": "Daha vakit varken bu yerde kabul et sen İsa'yı"
      }
