    "author": "Unknown",
    "key": "",
    "lyrics": [
      {
        "section": "V1",
        "chord": [],
        "line": "Mesih İsa gelecek, bize şifa verecek"
      },
      {
        "section": "C1",
        "chord": [],
        "line": "O mubarek Mesih İsa."
      },
      {
        "section": "C1",
        "chord": [],
        "line": "Yüzü, gözü nurluydu"
      },
      {
        "section": "C2",
        "chord": [],
        "line": "Mesih İsa gelecek,"
      },
      {
        "section": "C2",
        "chord": [],
        "line": "Bizi alıp gidecek"
      },
      {
        "section": "C3",
        "chord": [],
        "line": "Mesih İsa gelecek, Bizi göklere"
      },
      {
        "section": "C3",
        "chord": [],
        "line": "teslim edecek"
      },
      {
        "section": "C4",
        "chord": [],
        "line": "Mesih İsa bu muydu ?"
      },
      {
        "section": "C4",
        "chord": [],
        "line": "Gökteki melekler duydu"
      }
    ]
