      {
        "section": "C1",
        "chord": [],
        "line": "Bizim için kanını döktün."
      },
      {
        "section": "C2",
        "chord": [],
        "line": "Kanın bizi kurtarıyor,"
      },
      {
        "section": "C2",
        "chord": [],
        "line": "Hastalıktan kaldırıyor"
      },
      {
        "section": "C3",
        "chord": [],
        "line": "Sen hacında can verirken,"
      },
      {
        "section": "C3",
        "chord": [],
        "line": "Acıları sen çekerken"
      },
      {
        "section": "C4",
        "chord": [],
        "line": "Üç gün sonra kıyam ettin."
      },
      {
        "section": "C4",
        "chord": [],
        "line": "Rab İsam, sen göke gittin"
      },
      {
        "section": "C5",
        "chord": [],
        "line": "Ver bize sen saburundan."
      },
      {
        "section": "C5",
        "chord": [],
        "line": "Ver bize sen merhametinden"
      }
